import { useState } from "react";

const Compteur = () => {
  let [count, setCount] = useState(0);
  const clickOnMe = () => {
    setCount(count + 1);
  };
  return(
    <>
      <button onClick={clickOnMe}>Click me</button>
      <span data-testid="count">{count}</span>
    </>
  );
};

export default Compteur;
